import React from 'react';

const Navigation = () => {
    return (
        <>
            <div className="col-sm-4">
                <div>
                    <h1 className="font-weight-bolder">Weather</h1>
                    <h2 className="font-weight-light">Know Your Local Weather with mad ism</h2>
                </div>
            </div>
        </>
    )
}
export default Navigation
